INSERT INTO `posts` VALUES ('11', 'What were reading today', 'As has become a Friday tradition, here are five education stories to brighten your day. If the spirit moves you, please read, recommend, share, and respond on Medium! Also, Im looking to commission some new stories. If youre interested in contributing, reach out to me on Twitter (@sarika008) and Ill DM you my email address.', '1', '2015-08-08 00:18:41', '1');
INSERT INTO `posts` VALUES ('13', 'My Cujo', '\r\nOn the days that I have to leave early to work, I get very stressed out. But not for the reasons you might imagine. Every day, at around 6 a.m. theres this tiny wisp of a girl that walks dogs in my neighborhood. Correction: its the dogs that walk her around. Her smallest canine friend looks bigger than she doesand there', '1', '2015-08-08 03:00:33', '0');
